import React from 'react';
import classes from './Login.module.css';
const Login = () => {
  return (
    <div className={classes.LoginWrapper}>
      <div>
        <h2>Login Form</h2>
        <form>
          <input type='text' id='email' name='email' /> <br />
          <input type='text' id='password' name='password' />
        </form>
      </div>
    </div>
  );
};

export default Login;
